import React from 'react';
import Bot from './Bot';

const YourBotArmy = ({ enlistedBots, onRelease, onDelete }) => {
  return (
    <div>
      <h2>Your Bot Army</h2>
      {enlistedBots.map((bot) => (
        <Bot key={bot.id} bot={bot} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default YourBotArmy;
